import React from "react";

function Nav() {
  return (
    <div className="navbar">
      <img
        className="netflix_logo"
        src="https://upload.wikimedia.org/wikipedia/commons/thumb/0/08/Netflix_2015_logo.svg/1920px-Netflix_2015_logo.svg.png"
        alt="Netflix Logo"
      />
      <img
        className="nav_avatar"
        src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.pinterest.com%2Fpin%2F403212972886896384%2F&psig=AOvVaw1P3HPz705t0AFM-7Prlh2H&ust=1603936866515000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCLiBqM-Y1uwCFQAAAAAdAAAAABAN"
        alt="Avatar"
      />
    </div>
  );
}

export default Nav;
